import { IconButton, Link } from "@material-ui/core";
import React from "react";
import ImageSlider from "./ImageSlider";

function Presentation(props) {
  const profile = {
    name: "Nha Vy VO DOAN",
    birthday: "29/04/1993",
    formation: "Wild Code School",
    localisation: "Bordeaux",
    langages: "Javascript, HTML, CSS",
    frameworks: "React JS, Node JS",
    methods: "agile",
    others:
      "mySQL, dbmongo, trello, git github, codesandbox, terminal, tailwind, material ui, whimsical",
  };
  return (
    <div>
      <img src="./me.png" alt="about-me" />
      <IconButton></IconButton>
       <img src="./github.png" alt="linkgithub" href="https://github.com/navyrandom"/>
    </div>
  );
}

export default Presentation;
